import React from "react";
import { LobbyContainer, LobbyTitle, LobbyItemsContainer } from "../../styledComponents/lobbyStyledComponents";

const Lobby: React.FC = () => {
    return (
        <LobbyContainer>
            <LobbyItemsContainer>
                Welcome to the lobby!
            </LobbyItemsContainer>

            <LobbyTitle>
                Welcome to the lobby!
            </LobbyTitle>
        </LobbyContainer>
    )
}

export default Lobby;
